import React from 'react';

const CheckoutSuccess = () => {
    return (
        <div className="container mb-4" style={{paddingTop:"180px",paddingBottom:"20px",minHeight:"90vh"}}>

            <h1 className='text-center'>Payment Success</h1>
            <div className='mt-4 mb-4 d-flex align-items-center justify-content-center'>
                <img src="https://www.nhahangquangon.com/wp-content/uploads/2020/10/icon-thanh-cong-200x200.png" 
                alt="checkout success" />
            </div>
        </div>
    );
}

export default CheckoutSuccess;
